import { projects } from "../Data/data";

const Projects = () => {
    return (
        <div id="experience">
            {projects.map(item => (
                <div className="mb-12 flex" style={{color: "#888D91"}} key={item.id}>
                    <img src={item.image} alt=""/>
                    <div>
                        <p>{item.title}</p>
                        <p>{item.description}</p>
                    </div>
                </div>
            ))}
        </div>
    )
}

export default Projects;
